// let Highlight = 
//This is the main function returning the components to main page
const CouncilComponent = () => {

  //States for buttons
  const [SeState, setSeState] = React.useState(true);
  const [TeState, setTeState] = React.useState(false);
  const [BeState, setBeState] = React.useState(false);

  //This are the buttons
  function Buttons() {

    return (

      <div className="center" >
        <ButtonGroup aria-label="Basic example" >
          <Button variant="secondary" id="1" onClick={whichCouncil} >SE</Button>
          <Button variant="secondary" id="2" onClick={whichCouncil} >TE</Button>
          <Button variant="secondary" id="3" onClick={whichCouncil} >BE</Button>
        </ButtonGroup>
      </div>
    )

  }

  //This function returns images of respective memberCards

  const whichCouncil = (e) => {
    const id = e.target.id;
    e.target.setvariant = "primary";
    // const {name,value}=e.target;
    //e.preventDefault();
    if (id === "1") {
      setSeState(true);
      // setSeActive(true)
      //other two 
      setTeState(false);
      setBeState(false);
      // setTeActive(false)
      // setBeActive(false)
    }
    else if (id === "2") {
      setTeState(true);
      //other two
      setSeState(false);
      setBeState(false);
    }
    else if (id === "3") {
      setBeState(true);
      //other two
      setSeState(false);
      setTeState(false);
    }
  }

  return (
    <Container>
      <Buttons />

      <Row className='container'>
        {SeState ? SEmembersCards : null}
        {TeState ? TEmembersCards : null}
        {BeState ? BEmembersCards : null}
      </Row>
    </Container>
  );
}

export default CouncilComponent;